import React from 'react';
import styled from 'styled-components';

const HomeContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: calc(100vh - 140px); /* Adjusted for Navbar and FilterBar height */
  text-align: center;
`;

const HomeTitle = styled.h2`
  font-size: 2.5rem;
  color: white;
`;

function Home() {
  return (
    <HomeContainer>
      <HomeTitle>CENTRO BUS PREDICTOR</HomeTitle>
    </HomeContainer>
  );
}

export default Home;
